----Store procedure Usuario
--insert
create procedure [dbo].[InsertarUsuario]
@id bigint,
@Contrasenna varchar(20),
@TipoUsuario int
as
begin
insert into Usuario ([id],[contrasenna],[tipoUsuario]) values (@id,encryptbypassphrase('password',@contrasenna),@TipoUsuario)
end;

go


--Selecionar todos USuarios
create procedure [dbo].[SelecionarTodosUsuarios]
as 
begin 
select *from usuario
end;
go




---Store tipoUsuarios
create procedure [dbo].[SeleccionarTiposUsuario]
as

begin
select *from tipoUsuario
end;
go

--Traer TipoUsuario
create procedure [dbo].[TraerTipoUsuario]
@Descripcion nvarchar(20)
as

begin
select *from tipoUsuario where tipoUsuario.Descripcion=@Descripcion
end
go

--sleccionar usuario por identificacion--
create procedure [dbo].[SeleccionaUsuarioXIdentificacion] @id bigint
as
begin

select id,convert(varchar,decryptbypassphrase('password',usuario.contrasenna)) 
as contrasenna,usuario.tipoUsuario,usuario.estado from usuario where usuario.id=@id
end
go

---Store procedure Cliente
--Insertar

create Procedure [dbo].[InsertarCliente]
@Id bigint ,
@Nombre varchar(50),
@sNombre nvarchar(50),
@Apellido varchar(50),
@sApellido nvarchar(50),
@correo nvarchar(320),
@Telefono int,
@contrasenna nvarchar(20),
@tipoUsuario int
as

begin
exec [InsertarUsuario] @id,@contrasenna,@tipoUsuario
insert into Cliente([id],[nombre],[sNombre],[apellido],[sApellido],[correo],[telefono] )
values (@Id,@Nombre,@sNombre,@Apellido,@sApellido,@correo,@Telefono)

end;
go



--selecionar todos clientes
create procedure [dbo].[SelecionarTodosClientes]
as 
begin 
select *from Cliente inner join Usuario on cliente.id=usuario.id
end;
go


--Store direccion
--Insertar Direccion 
create procedure [dbo].[InsertarDireccion]
@codProvincia numeric(2,0),
@codCanton numeric (2,0),
@codDistrito numeric (2,0),
@codBarrio numeric (4,0),
@Sennas nvarchar(max)

as
begin 
insert into Direccion (codProvincia,codCantos,codDistrito,codBarrio,sennas) values(@codProvincia,@codCanton,@codDistrito,@codBarrio,@sennas)
end
go


---Store cliente-Direccion
--insertar Cliente-Direccion
create procedure [dbo].[InsertarClienteDireccion]
@idCliente bigint,
@idDireccion int,
@diaInicio int,
@diaFinal int,
@horaInicio time(7),
@horaFinal time(7)
as 
begin 
Insert into ClienteDireccion (idCliente,idDireccion,diaInicio,diaFinal,horaInicio,horaFinal) values (@idCliente,@idDireccion,@diaInicio,@diaFinal,@horaInicio,@horaFinal)
end
go
--seleccionar direcciones de cliente
create procedure [dbo].[SeleccionarDireccionesCliente]
@idCliente bigint
as
begin 
select *from ClienteDireccion where clienteDireccion.idCliente=@idCliente
end
go
--selecionar Direccion Especifica del cliente
create procedure [dbo].[SeleccionarDireccionEspecificaCliente]
@idCliente bigint,
@Direccion int
as
begin 
select *from ClienteDireccion where clienteDireccion.idCliente=@idCliente and clienteDireccion.idDireccion=@direccion
end
go



